class BotImageDownloader extends Command
{
    /**
     * The name and signature of the console command.
     *
     * @var string
     */
    protected $signature = 'wayak:imagedownloader';

    /**
     * The console command description.
     *
     * @var string
     */
    protected $description = 'Auxiliar command to download from urls to local path';

    /**
     * Create a new command instance.
     *
     * @return void
     */
    public function __construct()
    {
        parent::__construct();
    }

    /**
     * Execute the console command.
     *
     * @return int
     */
    public function handle()
    {
        $thumb_urls = self::getThumbUrls();
        foreach ($thumb_urls as $img_url) {
            
            $template_id = Str::random(10);
            $img_url_info = pathinfo($img_url);
            
            $full_file_path = public_path( 'magisto/design/template/'.$template_id.'/thumbnails/'.Str::random(10).'.jpg' );
            $path_info = pathinfo($full_file_path);
            $local_img_path = $path_info['dirname'];
            
            // print_r($full_file_path);
            // print_r($path_info);
            // print_r($local_img_path);
            // echo "<br>";
            // exit;

            if( file_exists( $full_file_path )  == false ){
                echo $full_file_path."\n";
                // exit;
                self::downloadImage($full_file_path, $img_url);
                
            }
            
        }
    }

    function downloadImage(  $local_img_path, $img_url ){
        
        
        $path_info = pathinfo($local_img_path);
        
        $path = $path_info['dirname'];

        // print_r("<pre>");
        // print_r($path_info['dirname']);
        // print_r($path);
        // print_r($path_info);
        // print_r($local_img_path);
        // exit;
    
        @mkdir($path, 0777, true);
    
        set_time_limit(0);
    
        //This is the file where we save the    information
        $fp = fopen ($local_img_path, 'w+');
    
        //Here is the file we are downloading, replace spaces with %20
        $ch = curl_init(str_replace(" ","%20",$img_url));
        curl_setopt($ch, CURLOPT_TIMEOUT, 50);
        
        // write curl response to file
        curl_setopt($ch, CURLOPT_FILE, $fp); 
        curl_setopt($ch, CURLOPT_FOLLOWLOCATION, true);
        
        // get curl response
        curl_exec($ch); 
        curl_close($ch);
        fclose($fp);
    }

